core::f16::<impl f16>::abs.doc:
Computes the absolute value of `self`.

This function always returns the precise result.

# Examples

```
#![feature(f16)]
# #[cfg(all(target_arch = "x86_64", target_os = "linux"))] {

let x = 3.5_f16;
let y = -3.5_f16;

assert_eq!(x.abs(), x);
assert_eq!(y.abs(), -y);

assert!(f16::NAN.abs().is_nan());
# }
```

f16::<impl f16>::hypot.doc:
Compute the distance between the origin and a point (`x`, `y`) on the
Euclidean plane. Equivalently, compute the length of the hypotenuse of a
right-angle triangle with other sides having length `x.abs()` and
`y.abs()`.

# Unspecified precision

The precision of this function is non-deterministic. This means it varies by platform,
Rust version, and can even differ within the same execution from one invocation to the next.

This function currently corresponds to the `hypotf` from libc on Unix
and Windows. Note that this might change in the future.

# Examples

```
#![feature(f16)]
# #[cfg(not(miri))]
# #[cfg(target_has_reliable_f16_math)] {

let x = 2.0f16;
let y = 3.0f16;

// sqrt(x^2 + y^2)
let abs_difference = (x.hypot(y) - (x.powi(2) + y.powi(2)).sqrt()).abs();

assert!(abs_difference <= f16::EPSILON);
# }
```

f16::<impl f16>::ln_1p.doc:
Returns `ln(1+n)` (natural logarithm) more accurately than if
the operations were performed separately.

This returns NaN when `n < -1.0`, and negative infinity when `n == -1.0`.

# Unspecified precision

The precision of this function is non-deterministic. This means it varies by platform,
Rust version, and can even differ within the same execution from one invocation to the next.

This function currently corresponds to the `log1pf` from libc on Unix
and Windows. Note that this might change in the future.

# Examples

```
#![feature(f16)]
# #[cfg(not(miri))]
# #[cfg(target_has_reliable_f16_math)] {

let x = 1e-4_f16;

// for very small x, ln(1 + x) is approximately x - x^2 / 2
let approx = x - x * x / 2.0;
let abs_difference = (x.ln_1p() - approx).abs();

assert!(abs_difference < 1e-4);
# }
```

Out-of-range values:
```
#![feature(f16)]
# #[cfg(not(miri))]
# #[cfg(target_has_reliable_f16_math)] {

assert_eq!((-1.0_f16).ln_1p(), f16::NEG_INFINITY);
assert!((-2.0_f16).ln_1p().is_nan());
# }
```

core::f16::<impl f16>::copysign.doc:
Returns a number composed of the magnitude of `self` and the sign of
`sign`.

Equal to `self` if the sign of `self` and `sign` are the same, otherwise equal to `-self`.
If `self` is a NaN, then a NaN with the same payload as `self` and the sign bit of `sign` is
returned.

If `sign` is a NaN, then this operation will still carry over its sign into the result. Note
that IEEE 754 doesn't assign any meaning to the sign bit in case of a NaN, and as Rust
doesn't guarantee that the bit pattern of NaNs are conserved over arithmetic operations, the
result of `copysign` with `sign` being a NaN might produce an unexpected or non-portable
result. See the [specification of NaN bit patterns](primitive@f32#nan-bit-patterns) for more
info.

# Examples

```
#![feature(f16)]
# #[cfg(all(target_arch = "x86_64", target_os = "linux"))] {

let f = 3.5_f16;

assert_eq!(f.copysign(0.42), 3.5_f16);
assert_eq!(f.copysign(-0.42), -3.5_f16);
assert_eq!((-f).copysign(0.42), 3.5_f16);
assert_eq!((-f).copysign(-0.42), -3.5_f16);

assert!(f16::NAN.copysign(1.0).is_nan());
# }
```

